import React, { useState } from 'react';
import classNames from 'classnames/bind';
import styles from './Header.module.scss';
import ButtonComponent from '../../components/ButtonComponent/ButtonComponent'; // Đảm bảo đường dẫn đúng

// Import các component từ Ant Design
import { Drawer } from 'antd';
import { MenuOutlined } from '@ant-design/icons';

const cx = classNames.bind(styles);

function Header() {
    // State để quản lý việc hiển thị Drawer
    const [openDrawer, setOpenDrawer] = useState(false);

    const showDrawer = () => {
        setOpenDrawer(true);
    };

    const onCloseDrawer = () => {
        setOpenDrawer(false);
    };

    // Giả sử có một biến trạng thái đăng nhập để điều khiển nút
    // Bạn sẽ thay thế 'false' bằng logic kiểm tra đăng nhập thực tế của bạn
    const isLoggedIn = false; // Ví dụ: false = chưa đăng nhập, true = đã đăng nhập

    return (
        <div className={cx('wrapper')}>
            <div className={cx('logo')}>
                <img
                    src="data:image/png;base64,"
                    alt=""
                />
            </div>
            <div className={cx('header-actions')}>
                {/* Các nút cho màn hình lớn */}
                <div className={cx('desktop-buttons')}>
                    {!isLoggedIn ? (
                        <ButtonComponent
                            width="209px"
                            height="100%"
                            backgroundColor="#9c69e2"
                            border="none"
                            borderRadius="50px"
                            size="1.6rem"
                            weight="700"
                            textButton="Sign In"
                            link="login"
                        />
                    ) : (
                        <>
                            <ButtonComponent
                                width="209px"
                                height="100%"
                                backgroundColor="#9c69e2"
                                border="none"
                                borderRadius="50px"
                                size="1.6rem"
                                weight="700"
                                textButton="Profile"
                            />
                            <ButtonComponent
                                width="209px"
                                height="100%"
                                backgroundColor="#9c69e2"
                                border="none"
                                borderRadius="50px"
                                size="1.6rem"
                                weight="700"
                                textButton="Logout"
                            />
                        </>
                    )}
                </div>

                {/* Icon Menu cho màn hình nhỏ */}
                <div className={cx('mobile-menu-icon')} onClick={showDrawer}>
                    <MenuOutlined style={{ fontSize: '24px', color: '#333' }} />
                </div>
            </div>

            {/* Drawer chứa các ButtonComponent cho màn hình nhỏ */}
            <Drawer
                title="Menu"
                placement="right"
                onClose={onCloseDrawer}
                open={openDrawer}
                className={cx('mobile-drawer')} // Thêm class để tùy chỉnh CSS
            >
                {/* Các nút hiển thị trong Drawer */}
                <div className={cx('drawer-buttons-container')}>
                    {!isLoggedIn ? (
                        <ButtonComponent
                            width="100%" // Điều chỉnh chiều rộng cho phù hợp trong Drawer
                            height="50px"
                            backgroundColor="#9c69e2"
                            border="none"
                            borderRadius="50px"
                            size="1.6rem"
                            weight="700"
                            textButton="Sign In"
                            link="login"
                            onClick={onCloseDrawer} // Đóng Drawer khi click
                        />
                    ) : (
                        <>
                            <ButtonComponent
                                width="100%"
                                height="50px"
                                backgroundColor="#9c69e2"
                                border="none"
                                borderRadius="50px"
                                size="1.6rem"
                                weight="700"
                                textButton="Profile"
                                onClick={onCloseDrawer}
                            />
                            <ButtonComponent
                                width="100%"
                                height="50px"
                                backgroundColor="#9c69e2"
                                border="none"
                                borderRadius="50px"
                                size="1.6rem"
                                weight="700"
                                textButton="Logout"
                                onClick={onCloseDrawer}
                            />
                        </>
                    )}
                </div>
            </Drawer>
        </div>
    );
}

export default Header;
